import { html } from "lit";
import PermissionRequestFormBase from "../../../../shared/src/main/web/permission-request-form-base.js";

import "https://cdn.jsdelivr.net/npm/@shoelace-style/shoelace@2.11.2/cdn/components/input/input.js";
import "https://cdn.jsdelivr.net/npm/@shoelace-style/shoelace@2.11.2/cdn/components/button/button.js";
import "https://cdn.jsdelivr.net/npm/@shoelace-style/shoelace@2.11.2/cdn/components/alert/alert.js";

class PermissionRequestForm extends PermissionRequestFormBase {
  static properties = {
    connectionId: { attribute: "connection-id" },
    dataNeedId: { attribute: "data-need-id" },
    countryCode: { attribute: "country-code" },
    companyId: { attribute: "company-id" },
    jumpOffUrl: { attribute: "jump-off-url" },
    _requestId: { type: String },
    _requestStatus: { type: String },
  };

  constructor() {
    super();

    this._requestStatus = "";
  }

  handleSubmit(event) {
    event.preventDefault();

    const payload = {
      connectionId: this.connectionId,
      dataNeedId: this.dataNeedId,
      companyId: this.companyId,
      countryCode: this.countryCode,
      jumpOffUrl: this.jumpOffUrl,
    };

    this.createPermissionRequest(payload)
      .then(({ redirectUri }) => {
        window.open(redirectUri, "_blank");
      })
      .catch((error) => this.error(error));
  }

  render() {
    return html`
      <div>
        <header>
          <h2>Green Button</h2>
          <p>
            <a href="https://greenbuttondata.org/">Green Button</a> is an international standard for sharing utility
            customer bill and usage data. The Green Button
            standard is fairly complex, but in general it specifies three things:
          <ul>
            <li>XML format for customer utility data</li>
            <li>REST API for downloading the XML data</li>
            <li>OAuth method for authorizing data sharing</li>
          </ul>
          </p>
        </header>

        <form id="request-form">
          <p>
            By clicking on this button, you will access your personal Utility Api
            account where you can authorise Utility Api to send us your data.
          </p>

          <label for="submit" style="cursor: pointer">
            <!-- temporary encoding of enedis action button as base64 -->
            <img
              alt="Share your UtilityAPI data"
              src="data:image/png;base64,"
              height="120"
              width="120"
              style=""
            />
          </label>
          <input id="submit" type="submit" hidden />
          <p>
            <sup>
              GREEN BUTTON and the Green Button Logo are trademarks owned by Departments of the U.S. Government and/or
              Green Button Alliance, Inc.
            </sup>
          </p>
        </form>
      </div>
    `;
  }
}

export default PermissionRequestForm;
